def all_left_right_truncatable_prime(numbers):
    def is_prime(n):
        if n < 2:
            return False
        for i in range(2, int(n**0.5)+1):
            if n % i == 0:
                return False
        return True

    def is_truncatable_prime(n):
        if '0' in str(n):
            return False
        str_n = str(n)
        for i in range(1, len(str_n)):
            if not is_prime(int(str_n[i:])):
                return False
            if not is_prime(int(str_n[:-i])):
                return False
        return True

    x = numbers[6]
    result = []
    for i in range(2, x+1):
        if is_prime(i) and is_truncatable_prime(i):
            result.append(i)
    return sorted(result, reverse=True)
```
Note: The function can be called with a tuple of positive integers as its argument to find the left-and-right-truncatable prime numbers less than or equal to the integer at index 6.
